type ApiService interface {
	// ==================== 导入接口 ====================
	// 导入班级及学生数据（JSON格式）
	ImportClassData(ctx context.Context, req *ImportDataRequest) (r *common.BaseResponse, err error)
	// 导入班级及学生数据（Excel文件）
	// 注意：此接口使用multipart/form-data，无法在thrift中完整定义，需手动实现
	// POST /v1/import/excel
	// ==================== 班级相关接口 ====================
	// 获取班级信息
	GetClass(ctx context.Context, classID string) (r *common.Class, err error)
	// 获取所有班级列表
	ListClasses(ctx context.Context) (r []*common.Class, err error)
	// 删除班级
	DeleteClass(ctx context.Context, classID string) (r *common.BaseResponse, err error)
	// 导出班级花名册为Excel
	// 注意：此接口返回文件流，无法在thrift中完整定义，需手动实现
	// GET /v1/classes/:class_id/export
	// 获取班级积分排行榜
	// 注意：top参数通过查询参数传递，hz工具不支持多参数函数
	GetLeaderboard(ctx context.Context, classID string) (r []*LeaderboardItem, err error)
	// 获取班级统计信息
	GetClassStats(ctx context.Context, classID string) (r *ClassStats, err error)
	// ==================== 学生相关接口 ====================
	// 获取学生信息
	GetStudent(ctx context.Context, studentID string) (r *common.Student, err error)
	// 获取所有学生列表
	ListAllStudents(ctx context.Context) (r []*common.Student, err error)
	// 删除学生
	DeleteStudent(ctx context.Context, studentID string) (r *common.BaseResponse, err error)
	// ==================== 班级花名册相关接口 ====================
	// 获取班级花名册
	GetClassRoster(ctx context.Context, classID string) (r []*common.RosterItem, err error)
	// 从班级中移除学生
	RemoveStudentFromClass(ctx context.Context, enrollmentID string) (r *common.BaseResponse, err error)
	// ==================== 点名相关接口 ====================
	// 执行点名
	RollCall(ctx context.Context, req *RollCallRequest) (r *RollCallResponse, err error)
	// 点名结算
	SolveRollCall(ctx context.Context, req *SolveRollCallRequest) (r *common.BaseResponse, err error)
	// 重置点名状态（用于顺序/逆序点名）
	ResetRollCall(ctx context.Context, classID string) (r *common.BaseResponse, err error)
}

